
DROP DATABASE GardenApp;
CREATE DATABASE GardenApp;
USE GardenApp;

-- DROP TABLE IF EXISTS Users;
-- DROP TABLE IF EXISTS Plants;
-- DROP TABLE IF EXISTS Garden;
CREATE TABLE Users
(
    UserID INT AUTO_INCREMENT PRIMARY KEY,
    First_Name VARCHAR(20) NOT NULL,
    Last_Name VARCHAR(20) NOT NULL,
    Email VARCHAR(50) NOT NULL
);

CREATE TABLE Garden
(
    GardenID INT AUTO_INCREMENT PRIMARY KEY,
    Garden_Name VARCHAR(50) NOT NULL,
    UserID INT,
    PlantID INT,
    FOREIGN KEY (UserID) REFERENCES Users(UserID)
        ON DELETE CASCADE
        ON UPDATE CASCADE
);

CREATE TABLE Plants
(
    PlantID INT AUTO_INCREMENT PRIMARY KEY,
    Plant_Type VARCHAR(20) NOT NULL,
    Watering_Frequency VARCHAR(50) NOT NULL,
    Days_To_Water VARCHAR(50) NOT NULL,
    GardenID INT,
    FOREIGN KEY (GardenID) REFERENCES Garden(GardenID)
        ON DELETE CASCADE
        ON UPDATE CASCADE
);



